import React from 'react';
import '../../App.css';
export default function GitHub() {
  return (
    <>
      <h1 className='github'>GitHub</h1>
      <href src='https://github.com/ElectronicDynamicSystems'>LINK IR A GIT EDS</href>
      <Route path='/github' component={() => { 
     window.location.href = 'https://github.com/ElectronicDynamicSystems'; 
     return null;
}}/>
    </>
  );
}
